/*
Adjoint Code Design Pattern with dco/c++
pattern: StaticEvolutionRecursiveBinomialBisection
author: Uwe Naumann (2018)

Binomial checkpointing as in revolve (Griewank/Walter)
*/

#pragma once
#include "../StaticEvolutionRecomputeAll/ACDP_StaticEvolutionRecomputeAll.hpp"

struct ACDP_StaticEvolutionRecursiveBisection : ACDP_ArgCP {
  std::unique_ptr<ACDP_StaticEvolutionRecomputeAll> tgt;
  int n,m,base,ns,nc;
  static unsigned int cr[101][101];

  ACDP_StaticEvolutionRecursiveBisection(
    DCO_TT* context_tape, 
    ACDP_EvolutionStep* tgt, 
    int n, 
    int m, 
    int ns, // number of steps
    int nc // number of checkpoints
  ) : ACDP_ArgCP(context_tape), 
      tgt(new ACDP_StaticEvolutionRecomputeAll(context_tape,tgt,n,m,ns)), 
      n(n), m(m), base(0), ns(ns), nc(nc) {}

  int get_r(unsigned int l, unsigned int c) {
    assert(c>0);
    for (int r=0;r<101;r++) if (cr[c][r]>=l) return r;
    return -1;
  }

  int split(unsigned int ns, unsigned int nc) { 
      unsigned int neval=get_r(ns,nc);
      unsigned int crcm3r=(nc<3) ? 0 : cr[nc-3][neval];
      unsigned int crcm2rm1=(nc<2) ? 0 : cr[nc-2][neval-1];
      unsigned int crcm1rm1=(nc<1) ? 0 : cr[nc-1][neval-1];
      unsigned int crcrm1=(neval<1) ? 0 : cr[nc][neval-1];
      unsigned int crcrm2=(neval<2) ? 0 : cr[nc][neval-2];
      if (ns<=crcrm1+crcm2rm1) return crcrm2;
      else if (ns>=cr[nc][neval]-crcm3r) return crcrm1;
      else return ns-crcm1rm1-crcm2rm1;
      return ns/2;
  }

  void link() {
    if (!tgt->linked) {
      for (int i=0;i<n;i++)
        tgt->register_input(input(i));
      for (int i=0;i<m;i++)
        tgt->register_output(output(i));
      tgt->linked=true;
    }
  }

  void evaluate_primal() { 
    tgt->base=base; tgt->ns=ns; 
    tgt->evaluate_primal(); 
  }
  void evaluate_augmented_primal() { 
    tgt->link();
    push_args();
    tgt->base=base; tgt->ns=ns; 
    tgt->evaluate_primal(); 
  }

  void evaluate_adjoint() { 
    top_args(); pop_args();
    if (ns>2&&nc-1) {
      int base_all=base;
      int ns_all=ns;
      int split_pos=ns=split(ns_all,nc); 
      evaluate_augmented_primal();
      nc--; ns=ns_all-ns;
      push_args(); 
      base+=split_pos;
      evaluate_adjoint();
      nc++; ns=split_pos;
      base=base_all;
      evaluate_adjoint();
      ns=ns_all;
    } else {
      tgt->base=base; 
      tgt->ns=ns; 
      tgt->tgt->push_args(); 
      tgt->evaluate_adjoint();
    }
  }
};


